import React from 'react';

function Test() {
    return (
        <header className="bg-gray-800 text-white p-4 sm:p-6 md:p-8 lg:p-10 xl:p-12">
        <div className="container mx-auto">
          <div className="flex items-center justify-between">
            <h1 className="text-2xl sm:text-3xl md:text-4xl lg:text-5xl xl:text-6xl font-bold">Mon Application</h1>
            <nav className="hidden md:block">
              <ul className="flex space-x-4">
                <li><a href="#" className="text-gray-300 hover:text-white">Accueil</a></li>
                <li><a href="#" className="text-gray-300 hover:text-white">Produits</a></li>
                <li><a href="#" className="text-gray-300 hover:text-white">À propos</a></li>
                <li><a href="#" className="text-gray-300 hover:text-white">Contact</a></li>
              </ul>
            </nav>
            <div className="md:hidden">
              {/* Bouton de menu pour les résolutions mobiles */}
              {/* Vous pouvez implémenter la logique du menu déroulant ici */}
              <button className="text-gray-300 hover:text-white">
                <svg className="w-6 h-6" fill="none" viewBox="0 0 24 24" stroke="currentColor">
                  <path strokeLinecap="round" strokeLinejoin="round" strokeWidth="2" d="M4 6h16M4 12h16M4 18h16" />
                </svg>
              </button>
            </div>
          </div>
        </div>
      </header>

    );
}

export default Test;
